import React from "react";
import web from "../src/images/2.svg";
import "./App.css";
import { NavLink } from "react-router-dom";
import Common from "./Common";
const Home = () => {
  return (
    <>
      <Common name="Welcome to Home Page" imgsrc={web} visit="" btname="" />
    </>
  );
};

export default Home;
